タブレットを車にマウントしてカーナビのように使える車載ホルダー<img src='https://image.rakuten.co.jp/tokka-com/cabinet/tokka_zaiko.gif' border='0' alt='送料・在庫状況を確認する'><br><font color="#ff0000"><b>↑↑↑正確な在庫状況は上記バナー「送料・在庫状況を確認する」をクリックして頂き、必ずご確認ください。</b></font><br><br><br>■10インチサイズのタブレットまでを取り付けられるタブレット用の車載ホルダーです<br>■ホルダー部分にタブレットをセットしてタブレット本体を指で軽く押すだけでホールドできるワンタッチホールド機能により、簡単にタブレットをホルダーにホールドすることができます<br>■ボールジョイント構造により、タブレットをお好みの角度で使用することができます<br>■伸縮アームにより、タブレットを見やすい位置に前後調節することができます<br>■粘着性のあるゲル素材の吸盤を採用しているので、細かい凹凸のあるダッシュボードに直接取り付けることができます。 ※表面のシボ加工が粗いダッシュボードなどは吸盤がしっかりと吸着しない場合があります。その場合は付属の吸盤取り付けプレートをご使用ください。 ■レバー式の真空吸盤でしっかり固定することができます。 ■接着シート付きの吸盤取り付けプレートを付属しているので、吸盤が取り付けられない場所でも取り付けられます<br>サイズ：ホルダー/約W115xD46xH120mm(最小時) 吸盤マウント/約W78xD215xH63mm(アーム水平状態で最小時) 吸盤/直径78mm<br>重量：約343g(本体のみ)<br>耐荷重：800g以下<br>材質：本体/PC、ABS 吸盤部分/PU<br>対応機種：機器寸法が幅120～190mmで奥行き15mm以下、重量が800g以下のタブレット<br>セット内容：本体(ホルダー、吸盤マウント)、吸盤取付けプレート、アーム支持ブロック、ストッパー、取扱説明書使用上の注意<br>自動車運転中に本製品及び取付けた機器を操作しないでください。必ず安全な場所に停車してから操作してください。<br>運転者の視界及び運転操作を妨害する位置や、エアバッグの動きを妨害する位置には設置しないでください。<br>対応機器以外の物を本製品に取付けないでください。<br>平らな面にしっかりと設置してください。また、ぐらつきがある状態で使用しないでください。<br>不安定な角度で使用しないでください。<br>可動部に手などを挟まないように注意してください。<br>本製品の故障、またはその使用によって生じた事故や直接、間接の損害についてはメーカーはその責を負わないものとします。あらかじめご了承ください。<br>用途以外には使用しないでください。<br>本製品を分解･修理･加工･改造はしないでください。<br>本製品に強い振動や衝撃、無理な力を与えないでください。<br>本製品を高温または低温･多湿となる場所で長時間使用･放置すると、吸着力が低下し、脱落する場合がありますのでご注意ください。<br>お子様には本製品や付属品を触れさせないでください。<br>本製品のお手入れをする場合には、ベンジンやシンナーなどの揮発性有機溶剤が含まれているものは使用しないでください。<br>日光で取付けた機器が熱くなる場合があります。車内で長時間使用する際はご注意ください。<br>機器を設置したままで車内に放置しないでください。<br>ダッシュボードの材質が本革･合成皮革･スウェード･布張りなどの場合は表面仕上げを傷める場合がありますので取付けないでください。<br>吸盤の吸着力でダッシュボードが変形する場合があります。<br>取付ける際にウインカーレバーやシフトノブ、スイッチ等の操作に影響が無いかをご確認ください。<br>車内の高温･低温状態が長時間続くと固定が弱くなる場合があります。使用前に十分に固定されていることを確認してください。<br>本製品をダッシュボードに取付けたまま放置すると、ダッシュボードが変形･変色する場合があります。ダッシュボードが変形した場合、吸盤の吸着力が弱くなり、落下する恐れがあります。<br>取付ける車種や直射日光などの影響により、本製品の取付け部分が変色したり、日焼けによる取付け跡が残る場合があります。<br>吸盤全体がしっかりと密着していないと使用中に外れる恐れがあります。<br>ダッシュボード上の平滑で水平な場所を選んでください。<style type="text/css">
/*買い物カゴボタン*/
